O DIÁRIO DE ISIS por Stella Artois
ep #4 - 3 hábitos pessoais para acalmar mente e corpo!

Vocês sabem como eu sou agitada, né? No quarto e último episódio de Diário de Isis, trago para vocês 3 dos meus hábitos mais valiosos para conter um pouco minha hiperatividade no dia-a-dia! Primeiro de tudo, exercício físico! Ultimamente minha fonte de endorfina é o Muai Thay, que venho amando intercalar com Yoga. Além disso, conversar com a minha família e amigos é uma boa estratégia para diminuir a ansiedade! O famoso colo de mãe, né gente? Como acalma… Por fim, ler e escrever é muito importante para mim! É uma forma de botar para fora sentimentos e sensações e isso sossega muito minha mente! E vocês? O que andam fazendo para controlar a ansiedade? Me conta aqui nos comentários! Um beijo e até breve!

