Tem perfurme novo da Givenchy Beauty: o L'Interdit Rouge! 
O Brasil foi o primeiro país a lançar essa novidade, que traz um floral apimentado amadeirado. É uma fragrância sensual, envolvente e que tem uma ótima fixação. O frasco vermelho faz parte da paleta de cores Givenchy desde 1952. 
É uma cor que está presente na moda, na maquiagem e agora nas fragrâncias, reforçando tudo que o L'Interdit Rouge desperta: sensualidade, paixão e o lado proibido. Fico muito honrada de ser a embaixadora desta fragrância no Brasil❤️❤️❤️❤️❤️❤️❤️❤️❤️❤️❤️❤️
